	(4594,3252,'de','Zutaten: WEIZENMEHL, Rinderfett, Geschmacksverstrker (Mononatriumglutamat), Zucker, jodiertes Speisesalz, Kartoffelstrke, Tomatenpulver, Speisesalzersatz (Kaliumchlorid), Speisesalz, Maltodextrin, Farbstoff (Ammoniak-Zuckerkulr), Rindfleischextrakt, Zwiebelpulver, Aromen, Gewrze (Bockshornkleesamen, Liebstckel, Paprika, Pfeffer, Nelken), Randenpulver, Weissweinextrakt, Suerungsmittel (Citronensure), Antioxidationsmittel (Extrakt aus Rosmarin). Kann Spuren von Milch, Ei, Sellerie und Senf enthalten.'),
	(4595,3252,'fr','Ingrdients: farine de BL, graisse de bouf, exhausteur de got (glutamate monosodique), sucre, sel comestible iod, amidon de pomme de terre, tomate dshydrate, substitut du sel (chlorure de potassium), sel comestible, maltodextrine, colorant (caramel ammoniacal), extrait de viande de bouf, oignon dshydrat, arme, pices (fenugrec, livche, paprika, poivre, clous de girofle), betterave rouge dshydrate, extrait de vin blanc, acidifiant (acide citrique), antioxydant (extraits de romarin). Peut contenir des traces de: lait, ouf, cleri, moutarde.'),
	(4596,3253,'de','Weizenmehl, Maltodextrin, Mononatriumglutamat, Palmfett, Gemse getrocknet (Tomaten, Zwiebeln, Knoblauch), Hefeextrakt, Kochsalz jodiert, Kartoffelstrke, natrliche Aromen, Zucker, Rindfleischextrakt, Guarkernmehl, Sojasaucenpulver (Sojasauce aus Soja, Weizen, Dextrin, Kochsalz), frbender Gerstenmalzextrakt getrocknet, Gewrze, Butterpilzpulver, Rotwein-Extrakt'),
	(4597,3256,'de','Zutaten: 68% HARTWEIZENGRIESS, jodiertes Speisesalz, 6.8% Gemse (Zwiebelpulver, Karotten, Wirsing, SELLERIE, Lauch), Hefeextrakt, Fruktose, Palml, WEIZENKEIME, Gewrze (Curcuma, Pfeffer). Kann Spuren von Milch, Ei und Senf enthalten.'),
	(4598,3257,'de','Maltodextrin, WEIZENmehl, Pilze getrocknet und Pilzextrakt 14% (Champignons, Butterpilze), Tomatenpulver, modifizierte Maisstrke, jodiertes Kochsalz, Geschmacksverstrker: Mononatriumglutamat, getrocknete  Zwiebeln, Kartoffelstrke, Aromen (enthlt SOJA), Hefeextrakt, Zucker, Rapsl, Gewrze, Petersilie getrocknet.'),
	(4599,3257,'fr','Maltodextrine, farine de BL, champignons schs et extrait de champignons 14% (champignons de Paris, bolets jaunes), tomates en poudre, amidon modifi de mas, sel de cuisine iod, exhausteur de got: glutamate monosodique, oignons dshydrats, fcule de pommes de terre, armes (contient SOJA), extrait de levure, sucre, huile de colza, pices, persil sch.'),
	(4600,3257,'it','Maltodestrina, farina di FRUMENTO, funghi secchi ed estratto di funghi 14% (funghi prataioli, boleti gialli), pomodoro in polvere, amido modificato di granoturco, sale da cucina iodato, esaltatore di sapidit: glutammato monosodico, cipolle disidratate, fecola di patate, aromi (contiene SOIA), estratto di lievito, zucchero, olio di colza, spezie, prezzemolo essiccato.'),
	(4601,3263,'de','Kochsalz jodiert, Glukosesirup getrocknet, Geschmacksverstrker (Mononatriumglutamat, E 635), Wrze (SOJA), Palmfett, Hefeextrakt, Gewrze, Gemsepulver 0.3% (Lauch, Zwiebeln, Karotten), Aromen, SELLERIE-Extrakt.'),
	(4602,3263,'fr','Sel de cuisine iod, sirop de glucose dshydrat, exhausteurs de got (glutamate monosodique, E 635), condiment (SOJA), graisse de palme, extrait de levure, pices, poudre de lgumes 0.3% (poireau, oignons, carottes), armes, extrait de CLERI.'),
	(4603,3263,'it','Sale da cucina iodata, sciroppo di glucosio disidratato, esaltatori di sapidit (glutammato monosodico, E 635), condimento (SOIA), grasso di palma, estratto di lievito, spezie, verdure in polvere 0.3% (porro, cipolle, carote), aromi, estratto di SEDANO.'),
	(4604,3263,'de','Kochsalz jodiert, Glukosesirup getrocknet, Geschmacksverstrker (Mononatriumglutamat, E 635), Wrze (Soja), Palmfett, Hefeextrakt, Gewrze, Gemsepulver 0.3% (Lauch, Zwiebeln, Karotten), Aromen, Sellerie-Extrakt.\n\nKann enthalten: Gluten.'),
	(4605,3264,'de','Zutaten: 26% Gewrze (13% Paprika, Knoblauch, Zwiebeln, Cayennepfeffer, Koriander, schwarzer Pfeffer), jodiertes Speisesalz, WEIZENMEHL, Zucker, Hefeextrakt, EIWEISSPULVER, 4% Kruter (Thymian, Majoran, Rosmarin), Tomatenpulver, Aromen, Palml, Zitronensaftpulver. Aus nachhaltigem Anbau. Kann Spuren von Milch, Sellerie und Senf enthalten.');
